import React from "react";
import VideoItem from './VideoItem'

const VideoList = (props) => {
  const {videoList} = props.infoList
  const infoList = videoList.map((video, i)=>  <VideoItem key={i} thumbnail={video.snippet.thumbnails.default.url} channelId={video.snippet.channelId} title={video.snippet.title} />)
  return (
    <div className="ui items">
      {infoList}
    </div>
  );
};

export default VideoList;
